import { AxiosResponse } from "axios";
import $api from "../http";
import { IProfile } from "../models/IProfile";

export default class ProfileService {
    static fetchProfile(userId: string): Promise<AxiosResponse<IProfile>> {
        return $api.get<IProfile>(`/profiles/${userId}`);
    }
    
    static updateProfile(userId: string, profileData: Partial<IProfile>): Promise<AxiosResponse<IProfile>> {
        return $api.put<IProfile>(`/profiles/${userId}`, profileData);
    }
    
    static createProfile(profileData: Partial<IProfile>): Promise<AxiosResponse<IProfile>> {
        return $api.post<IProfile>('/profiles', profileData);
    }
    
    static deleteProfile(userId: string): Promise<AxiosResponse<void>> {
        return $api.delete<void>(`/profiles/${userId}`);
    }
}
